import React  from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
   Button, Label
} from 'reactstrap';


export default function Pregunta(props) {

    return (
        <div> 
            {props.preguns.map(v=><Label>{v.texto}</Label>)}
            {props.preguns.map(v=>v.respuestas).map(v=><Button color='primary'>{v.respuesta}</Button>)}


        </div >
    );
}
